INSERT INTO `huertosl_ceiba`.`pantillas_contrato` (`id_plantilla_contrato`, `codigo`, `contrato_html`) VALUES (1, 1, '<h1>CONTRATO PRIVADO DE CESIÓN DE DERECHOS A PLAZOS</h1>\n\n<p><strong>Contrato Privado de Cesión de Derechos a Plazos, que celebran en la Ciudad de Playa del Carmen</strong>, Municipio de Solidaridad, Estado de Quintana Roo, México, el <strong>{$fecha_contrato}</strong>, de una parte a quien de ahora en adelante se llamará <strong>“EL CEDENTE”</strong>, de una parte el Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, en su carácter de Propietario, y de la otra parte el C.: <strong>{$nombre_comprador}</strong>, a quién en lo sucesivo se le designará <strong>“EL CESIONARIO”</strong>, y que junto con <strong>“EL CEDENTE”</strong> se denominarán <strong>“LAS PARTES”</strong>, por su Propio y Personal Derecho respecto a una Fracción del Predio Rustico, ubicado en el Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, de la posesión de la Primera de los nombrados, lo que verifican al tenor de las siguientes Declaraciones y Cláusulas:</p>\n<h1>D E C L A R A C I O N E S</h1>  \n<p>El Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, con la Personalidad antes indicada; bajo Formal Protesta de Decir Verdad, Declara:</p>\n<ol type=\"\"I\"\">\n <li>Que es el propietario único y tiene la posesión en forma pública, pacífica y continua, y en Carácter de Propietario de la Fracción I perteneciente al Predio Rustico Denominado <strong>“La Ceiba”</strong>; ubicada en la localidad de Kantunilkin, Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, con las Colindancias Siguientes: <strong>al Noreste</strong>; en Seiscientos Cuarenta y Ocho Punto Cincuenta y Seis Metros con Ejido Playa del Carmen; <strong>al Sur</strong>; en Seiscientos Punto Cero Cero Metros con “Bulevar la Ceiba”, <strong>al Sureste</strong>; en Setecientos Trece  Punto Sesenta y tres Metros con Predio los Cedros; <strong>al Noroeste</strong>, en Ochocientos Diez  y Seis Punto Cuarenta Metros con Predio Patricia; con una Superficie de Cincuenta y tres Hectáreas, 45 Centiáreas y 27.79  Áreas.</li>\n <li>Que acredita la Posesión de la Fracción antes descrita y deslindada en la Declaración Primera, mediante Escritura Publica <strong>No. DOS CIENTOS CUARENTA Y NUEVE VOLUMEN TERCERO, TOMO “A”</strong>, celebrado ante Notario Público número treinta y tres a los 9 días del mes de Diciembre del año 2004 debidamente registrada ante la Dirección General del Registro Público de la Propiedad y del Comercio Delegación Cancún del Estado de Quintana Roo con el folio número <strong>149971</strong>.</li>\n <li>Que por así convenir a sus intereses, ha decidido subdividir en Fracciones convencionalmente el Predio Descrito y Deslindado en la Declaración Primera,  siendo materia de este Contrato la fracción marcada convencionalmente con el Numero {$n_manzana}, que a continuación se describe: <strong>MANZANA  {$n_manzana}</strong>,  del  Predio Rustico  denominado  “La Ceiba”  ubicado  en  la localidad  de  Kantunilkin, Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, con las Medidas y Colindancias Siguientes: <strong>Al Norte</strong>, 125.000 MTS. CON Mz. 29; <strong>Al Sur</strong>, 125.000 MTS. CON Mz. 27; <strong>Al Este</strong>, 70.00 MTS. CON Mz. 27; <strong>Al Oeste</strong>, 70.00 MTS. Con Sendero La Ceiba; con una Superficie total de 8,750.00 M2.</li>\n <li>El Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>; se obliga y compromete a realizar todos y cada uno de los trámites y gestiones necesarias ante la Dirección de Catastro y de Desarrollo Urbano, del Municipio de Lázaro Cárdenas; Estado de Quintana Roo, con el fin de obtener la Autorización de Subdivisión correspondiente a la Fracción I, de su Propiedad, descrito y deslindado en la Declaración Primera, resultando la Fracción marcada convencionalmente con el Numero <strong>{$n_lote}</strong>, en declaración III.</li>\n <li>El Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, en su Carácter de propietario, bajo formal Protesta de decir verdad, declara: que la Fracción marcada convencionalmente con el Número {$n_lote} motivo de la Presente Operación, no ha sido Cedida, Vendida o Comprometida en forma con anterioridad a este Acto. Y es el motivo del presente contrato ceder de manera definitiva en co-propiedad una superficie de {$superfice} m2, con las Medidas y Colindancias Siguientes: <strong>Al Norte</strong>, 46.012 MTS. CON Mz. 26 HUERTO. 15 MÁS 35.00 MTS. CON Mz. 26 HUERTO. 10; <strong>Al Sur</strong>, 45.468 MTS. CON Mz. 26 HUERTO. 13 MÁS 35.00 MTS. CON Mz. 26 HUERTO. 12; <strong>Al Este</strong>, 12.50 MTS. CON Mz. 27 HUERTO. 12 y <strong>Al Oeste</strong>, 12.50 MTS. Con Sendero La Ceiba;</li>\n <li>Declara <strong>“EL CESIONARIO”</strong>, que conoce el estado físico y jurídico que guarda la Fracción, materia del Presente contrato y que está de acuerdo conforme con adquirirlo en co-propiedad. </li>\n</ol>\n<p>Expuestas las anteriores Declaraciones, se otorgan las siguientes:</p>\n<h1>C L A U S U L A S</h1>\n<p><strong>PRIMERA.-</strong> El Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, en su Carácter antes indicado, Declara y Otorga: Que en uso de las facultades que tiene derecho: CEDE, de una manera definitiva, sin restricción y con la salvedad que más adelante aparece a <strong>“EL CESIONARIO”</strong>, los DERECHOS, que legítimamente tiene adquiridos y le corresponde, de la FRACCIÓN de Terreno marcada convencionalmente con el Numero {$n_lote} perteneciente a la Fracción I del Predio Rustico denominado <strong>“La Ceiba”</strong>, ubicada en la localidad de Kantunilkin, Municipio de Lázaro Cárdenas, Estado de Quintana Roo, México, descrita en la Declaración Quinta, la cual en lo conducente se tiene por reproducida en la presente Cláusula, como si se insertara a la letra, para todos los efectos legales; Predio que se encuentra Libre de Gravamen,  y sin ningún  Servicio Público, con todo cuanto de hecho y por derecho corresponde a dicho Inmueble, transfiriendo desde luego todos los DERECHOS que legítimamente tiene adquirido respecto a la citada Fracción de Terreno en co-propiedad.</p>\n<p><strong>SEGUNDA.-</strong> El Precio Convenido Total y Único de la CESION DE DERECHOS Consignada en el presente Contrato, lo Constituye la Suma de {$precio} ({$precio_texto}), cantidad que <strong>\"\"EL CESIONARIO\"\"</strong>, cubrirá a <strong>“EL CEDENTE”</strong> de la siguiente manera:</p>\n<p>Con un Enganche, por la Cantidad de {$enganche} ({$enganche_texto}) cantidad que <strong>“EL CEDENTE”</strong>, confiesa  recibir al momento de la firma del presente por parte de <strong>“EL CESIONARIO”</strong>, mediante transferencia electrónica de fondos en la cuenta y banco que para tal efecto <strong>“EL CEDENTE”</strong> indique en Billetes del Banco de México, de Curso legal, contados y revisados a su entera satisfacción y sin derecho a reclamación alguna posterior; sirviendo el mismo como el recibo más eficaz que en Derecho corresponda; Y el saldo, lo cubrirán <strong>“EL CESIONARIO”</strong> a  <strong>“EL CEDENTE”</strong>, mediante {$n_pagos} pagos {$periodo_de_pagos} y consecutivos por la cantidad de {$cantidad_pagos} ({$cantidad_pagos_texto}), cada día quince (15) de cada mes, debiendo efectuarse el Primer Pago el día <strong>{$fecha_primer_pago}</strong> y un último el día <strong>{$fecha_ultimo_pago}</strong> . En caso de que el día 15 del mes sea un día no hábil, el día de pago se recorrerá al siguiente día hábil, sin que esto se considere incumplimiento por parte de <strong>“EL CESIONARIO”</strong>, dicho pago se realizará a través de transferencia electrónica a la CLABE; 0446 9423 7005 2489 18 o en la cuenta 237 0052 4891 del banco SCOTIABANK a nombre de: FRANCISCO ENRIQUE MARTINEZ CORDERO.</p>\n<p>LAS PARTES acuerdan enfocar su esquema al Pagare General que se adjunta al presente contrato como Anexo 1.</p>\n<p><strong>TERCERA.-</strong> LAS PARTES hacen constar: Que el presente Contrato de Cesión de Derechos a Plazos, no es rescindible a causa o pretexto de lesión, en virtud de que el precio de la presente Operación fue fijado de común acuerdo por las propias partes. </p>\n<p><strong>CUARTA.-</strong> <strong>“EL CEDENTE”</strong>, Declara que se obliga y compromete a firmar a favor de <strong>“EL CESIONARIO\"\"</strong>, de la Persona Física o Moral que este designe, la Escritura Definitiva de Traslación de Dominio, siempre y cuando la autoridad correspondiente haya otorgado la autorización de subdivisión y la Escritura Pública; de la Fracción Descrita y Deslindada en la Declaración Primera; esto siempre y cuando <strong>\"\"EL CESIONARIO\"\"</strong>, haya liquidado en su totalidad el precio establecido.</p>\n<p><strong>QUINTA.-</strong> <strong>“EL CESIONARIO”</strong>, se obligan y compromete a realizar todos y cada uno de los trámites y aportaciones necesarias ante las autoridades correspondientes, para la obtención de los Servicios de Urbanización (Luz, Agua, Drenaje, Pavimentación, etc.) que en su momento oportuno se debieran efectuar. (O adquirir con sus recursos propios, los servicios que necesite de manera alternativa; celdas solares, pozo de agua, con filtros, biodigestores certificados, pavimentación, etc.</p>\n<p><strong>SEXTA.-</strong> <strong>\"\"EL CESIONARIO”</strong>, se obliga y compromete a realizar el pago de Mil Quinientos Pesos Anuales, al Ejido de Playa del Carmen, Municipio de Solidaridad, los cuales serán utilizados para el cuidado, mantenimiento y Vigilancia del acceso General, indirectamente incluyendo la Fracción Adquirida en el Presente Contrato. Dicho pago se realizará directamente en la Casa Ejidal de Playa del Carmen siguiendo los protocolos que para este fin, la autoridad Ejidal hubiese determinado.</p>\n<p><strong>SEPTIMA.-</strong> Todos los gastos, impuestos derechos y honorarios relacionados con el otorgamiento del presente Contrato Privado de Cesión de Derechos a Plazos, serán cubiertos únicamente por <strong>“EL CESIONARIO”</strong>.</p>\n<p><strong>OCTAVA.-</strong> De conformidad las partes acuerdan que los Gastos, Impuestos, Derechos y Honorarios, impuestos sobre la renta y el impuesto cedular derivados y/o causados por la formalización Notarial del Contrato Definitivo de Compra-Venta serán por cuenta de las partes en 2 porciones iguales del 50% del costo de cada uno de dichos conceptos.</p>\n<p><strong>NOVENA.-</strong> Las partes convienen en celebrar este contrato por su propia y libre voluntad y manifiestan que no han sufrido coacción, violencia, error, dolo o engaño alguno.</p>\n<p><strong>DECIMA.-</strong> Las partes reconocen que si durante la vigencia del presente contrato, llegara a fallecer el <strong>C. FRANCISCO ENRIQUE MARTINEZ CORDERO</strong>, éste declara como beneficiario y/o sustituto de sus derechos y obligaciones a la <strong>C. VICTORIA REGALADO PEREZ</strong>, quien se identifica y acredita en su carácter de esposa.</p>\n<p><strong>DÉCIMA PRIMERA.-</strong> <strong>“EL CEDENTE”</strong> y <strong>“EL CESIONARIO”</strong>,  acuerdan que se entiende: entregado el predio físicamente desde el momento que se haya firmado el presente contrato privado de cesión de derechos. \nAsimismo a partir de la fecha de entrega de <strong>“LA ESCRITURA PUBLICA DEFINITIVA EN CO-PROPIEDAD”</strong> objeto del presente contrato, <strong>“EL CESIONARIO”</strong> se obligara a pagar el impuesto predial, y demás contribuciones correspondientes que se causen con motivo de la posesión o el uso del mismo.</p>\n<p><strong>DÉCIMA SEGUNDA.-</strong> LAS PARTES declaran expresamente que el objeto de la futura compra - venta de la <strong>fracción {$n_lote}</strong>, es la de sub-dividir para obtener la escrituración individualizada por cuenta y costo de los co-propietarios, aceptando de manera voluntaria e incondicional firmar la subdivisión del predio que se adjudicó.</p>\n<p><strong>DECIMA TERCERA.-</strong> Para todo lo relativo a la interpretación cumplimiento y ejecución del presente contrato, en caso de Juicio las partes se someten de manera expresa a la Jurisdicción y competencia del Juzgado Civil de Primera Instancia del Distrito Judicial de Lázaro Cárdenas Estado de Quintana Roo, México, renunciando a cualquier otro fuero que pudiera corresponderles, en razón de su domicilio o vecindad, presente o futura.</p> \n<p><strong>DECIMA CUARTA.-</strong> <strong>“EL CESIONARIO”</strong> declara que acepta la Cesión de Derechos a Plazos, que se otorga a su favor, en las Declaraciones, de acuerdo a los términos establecidos en las cláusulas anteriores.</p>\n<p><strong>DECIMA QUINTA.-</strong> <strong>“EL CESIONARIO”</strong> podrá traspasar su derecho a un tercero, previa autorización de la parte <strong>“CEDENTE”</strong>.</p>\n<h1>PENALIZACIONES</h1>\n<p>Las partes han decidido estipular como penalización: </p>\n<ol type=\"\"i\"\">\n <li>En caso de impuntualidad en los pagos mensuales se cargara el 1% del pago vencido por cada día hábil que se retrase, hasta cubrir el adeudo, considerando que, en caso de que el día de pago sea un día no hábil, el día de pago se recorrerá al siguiente día hábil;</li>\n <li>en caso de no cubrir 6 pagos se da por rescindido el presente contrato de manera automática sin ningún requerimiento de aviso, ni tramite, renunciando de esta manera a cualquier reclamación presente o futura de pagos realizados, y/o mejoras realizadas en el terreno, por parte de <strong>“EL CESIONARIO”</strong>,</li>\n</ol>\n<h1>DATOS G E N E R A L E S</h1>                    \n<p>Los Contratantes por sus generales bajo Formal Protesta de decir verdad declaran ser: el Señor <strong>FRANCISCO ENRIQUE MARTÍNEZ CORDERO</strong>, Casado, Arquitecto, Natural de Cozumel; Estado de Quintana Roo, donde nació el día Cinco de Mayo del año de Mil Novecientos Sesenta y Uno, y vecino de esta Localidad, con domicilio en Ave. Montes Azules esquina Solidaridad mz.16, lt.14, de la colonia Bosque Real en Playa del Carmen Quintana Roo y <strong>ALFONSO RODRIGO TOLEDO NUÑEZ con domicilio en CALLE ASTURIAS 175-7 COLONIA ALAMOS 03400, BENITO JUAREZ D. F.</strong></p>\n<p>Y para constancia y seguridad de las partes, se firma el presente Contrato Privado de Cesión de Derechos, en la <strong>Ciudad de Playa del Carmen, Municipio de Solidaridad</strong>, Estado de Quintana Roo, México, el primer día del mes de Agosto del año dos mil dieciséis.</p>\n<table>\n <thead>\n  <tr>\n   <th>EL CEDENTE</th>\n   <th>EL CESIONARIO</th>\n  </tr>\n </thead>\n <tbody>\n  <tr>\n   <td>FRANCISCO ENRIQUE MARTÍNEZ CORDERO </td>\n   <td>ALFONSO RODRIGO TOLEDO NUÑEZ</td>\n  </tr>\n </tbody>\n <tfoot>\n  <tr>\n   <td>TESTIGO</td>\n   <td>TESTIGO</td>\n  </tr>\n </tfoot>\n</table>\n<h1>ANEXO 1</h1>\n<h1>PAGARE GENERAL</h1>\n<p>El C. ALFONSO RODRIGO TOLEDO NUÑEZ (el Deudor) con generales establecidas en el contrato de fecha 15 de Agosto de 2016 del cual forma parte integral el presente anexo y el C. FRANCISCO ENRIQUE MARTÍNEZ CORDERO (el Acreedor), con generales establecidas en las declaraciones del presente contrato, a través de este documento, un “PAGARE GENERAL” que establece lo siguiente:</p>\n<p>Primero: El deudor acepta y se compromete a pagar la deuda contraída con el acreedor, la cual asciende a la cantidad de $110,000.00 (Ciento Diez Mil  Pesos 00/100 MN).</p>\n<p>Segundo: De mutuo acuerdo se establece el siguientes fechas de vencimiento:</p>\n<table>\n <thead>\n  <tr>\n   <th>Concepto</th>\n   <th>Monto a pagar</th>\n   <th>Fecha de pago</th>\n  </tr>\n </thead>\n <tbody>\n  <?php $enganche = 10000; $pagos = 1500; $total = $enganche;?>\n  <tr>\n   <td>ENGANCHE</td>\n   <td>$<?= number_format($enganche,2) ?></td>\n   <td>{$fecha}</td>\n  </tr>\n  <?php for($i=1; $i<=67; $i++) {?>\n  <tr>\n   <td>PAGO <?= $i?></td>\n   <td>$<?= number_format($pagos,2) ?></td>\n   <td>{$fecha}</td>\n  </tr>\n  <?php \n   $total+=$pagos;\n  } \n  ?>\n </tbody>\n <tfoot>\n <tr>\n  <td>TOTAL:</td>\n  <td>$<?= number_format($total,2) ?></td>\n  <td></td>\n </tr>\n </tfoot>\n</table>\n<p>El deudor pagará mensualmente $1,500 (Un Mil Quinientos pesos 00/100 MN) en un plazo no mayor a 67 meses a partir del inicio de este plan de pagos a la cuenta definida por el acreedor:\n<div>SCOTIABANK SUCURSAL 005</div>\n<div>A NOMBRE DE FRANCISCO ENRIQUE MARTINEZ CORDERO</div>\n<div>NUMERO DE CUENTA 237 0052 4891</div>\n<div>CLABE INTERBANCARIA 0446 9423 7005 2489 18</div>\nEL deudor podrá, si así lo considera necesario, adelantar pagos con la intención de reducir su plazo de pago, o en su defecto, el monto mensual a pagar. Para tal efecto, El deudor y el Acreedor se pondrán de acuerdo sobre la modificación correspondiente en el presente anexo del contrato.</p>\n<p>APLICACIÓN DE VENCIMIENTO ANTICIPADO: “El Deudor/Suscriptor” reconoce y acepta que a la falta de pago oportuno de SEIS o más amortizaciones que conforme a este pagaré deba realizar, generará el vencimiento anticipado de los demás pagos sucesivos que falten por vencer y por lo tanto se da por rescindido el contrato objeto de la presente obligación, de manera automática sin ningún requerimiento de aviso, ni tramite, renunciando de esta manera a cualquier reclamación presente o futura de pagos realizados, y/o mejoras realizadas en el terreno, por parte del Cesionario.</p>\n<p>CARGOS POR MORA.- En caso de que cualquier cantidad pagadera al Acreedor bajo este plan de pagos no sea pagada a su vencimiento, el Saldo Insoluto del presente Pagaré vencerá anticipadamente en ese momento y sin necesidad de aviso o requerimiento previo, el Suscriptor pagara a la vista del Acreedor, una pena por mora de 1.0% (UNO punto cero por ciento por cada día hábil) hasta que se reciba el pago.</p>\n<p>JURISDICCION Y LEY APLICABLE: Para la interpretación, ejecución, cumplimiento de este pagaré y en su caso para el requerimiento judicial del pago de su importe serán competentes los tribunales de la ciudad de Lázaro Cárdenas, Estado de Quintana Roo, México, renunciando expresamente a cualquier otro fuero que por razón de sus domicilios presentes o futuros pudieran corresponderles.</p>\n<p>El presente plan de pagos se establece el día quince del mes de Agosto del año 2016  en la ciudad de México .</p>\n<table>\n <thead>\n  <tr>\n   <th></th>\n   <th></th>\n  </tr>\n </thead>\n <tbody>\n  <tr>\n   <td>FRANCISCO ENRIQUE MARTÍNEZ CORDERO </td>\n   <td>ALFONSO RODRIGO TOLEDO NUÑEZ</td>\n  </tr>\n </tbody>\n <tfoot>\n  <tr>\n   <td>TESTIGO</td>\n   <td>TESTIGO</td>\n  </tr>\n </tfoot>\n</table> ');
